import React from 'react';
import brain from './brain.png'
const Navigation = () => {
    return (
        <div className>
            <header className="bg-white black-80 tc pv4 avenir">
              <img height="60"
                   width="60" 
                   alt="brain logo" 
                   src={brain}></img>
                <h1 className="mt2 mb0 baskerville i fw1 f1">Smart Brain</h1>
                <nav className="bt bb tc mw7 center mt4">
                    <a className="f4 f5-l link bg-animate black-80  underline dim dib pa3 ph4-l" href="/">Home</a>
                    <a className="f4 f5-l link bg-animate black-80  underline dim dib pa3  ph4-l" href="/portfolio">Portfolio</a>

                    <a className="f4 f5-l link bg-animate black-80  underline dim dib pa3 ph4-l" href="/about">About</a>
                </nav>
            </header>
        </div>
    );
}

export default Navigation;
